Thought is a response to an event (past or future). We experience or anticipate something, and we react by having a thought.

Thoughts instigate a chemical response in the body. I call it a unique cocktail of various chemical compounds (neurotransmitters) that are being passed around from neuron to neuron, nerve to nerve. This chemical reaction will last for up to 90 seconds and will define an emotion we feel.

There are over 100 known agents that can act as neurotransmitters and there are about 34000 emotions mapped by neuroscientists.

Emotional intelligence begins with our ability to name an emotion that we are feeling. If you struggle to identify them and your emotions can be placed into only two categories of upset / sad - this is your opportunity to begin the journey of understanding self.

After the short-lived 90 second emotional response, the journey moves into the physical response realm. An emotion will manifest in our body as a physical sensation.

